import { Formik } from "formik";
import React from "react";
import * as Yup from "yup";
const initialValues = {
  title: "",
  descriptions: "",
  parent_id: "",
  is_active: "",
  show_in_menu: "",
  image: "",
};

const onSubmit = () => {
  console.log("test");
};

const validationSchema = Yup.object({});

export const FormikAddItems = () => {
  return (
    <Formik
      initialValues={initialValues}
      onSubmit={onSubmit}
      validationSchema={validationSchema}
    >
        
    </Formik>
  );
};
